import { Box } from "@material-ui/core";
import React from "react";
import Hero from "../Components/Hero";
import Form from "../Components/ContactUs/";

const gap = "100px";
let header = {
  hero: {
    heading: "Contact Us",
    page: "Contact Us",
    image: "/assets/image.png"
  }
};
function ContactUs() {
  return (
    <>
      <Hero {...header.hero} />
      <Box height={gap} />
      <Form/>


    </>
  );
}

export default ContactUs;
